import styled from "styled-components";

const HeaderContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Header = () => {
  return (
    <HeaderContainer>
      <h1>Kyle Garrett Photography</h1>
    </HeaderContainer>
  );
};

export default Header;
